import "./App.css";
import Form from './component/Form';
import ToDoList from './component/ToDoList';
 

function App () {
    const [inputText, setInputText] = useState ('');
    const[todos , setTodos] =  useState([])

  return (
    <div className="App">
      <header>
    <h1>TODO  LIST</h1>
</header>

< Form 

todos={todos}
setTodos={setTodos}
inputText={inputText}
setInputText={setInputText}
/>
<ToDoList todos={todos} setTodos={setTodos}/>
    </div>
  );
}



export default App;
